import React from 'react';
import PropTypes from 'prop-types';

// app
import styles from './Claims.styles';
import { AccessControl, Button, Layout, SectionHeader, Translate } from 'components';
import { ClaimsList } from 'modules';
import * as utils from 'utils';

// mui
import { makeStyles } from '@material-ui/core';
import DescriptionIcon from '@material-ui/icons/Description';

ClaimsView.propTypes = {
  handleClaimsProcessing: PropTypes.func.isRequired,
  handleComplexityRulesManagement: PropTypes.func.isRequired,
  handleCreateClaim: PropTypes.func.isRequired,
  handleRegisterNewLoss: PropTypes.func.isRequired,
};

export function ClaimsView({ handleClaimsProcessing, handleRegisterNewLoss, handleComplexityRulesManagement, handleCreateClaim }) {
  const classes = makeStyles(styles, { name: 'Claims' })();

  return (
    <Layout testid="claims">
      <Layout main>
        <SectionHeader
          title={<Translate label={utils.string.t('claims.pageTitle')} />}
          icon={DescriptionIcon}
          nestedClasses={{ children: classes.headerButtons }}
          testid="claims"
        >
          <div className={classes.headerContent}>
            <Button
              onClick={handleClaimsProcessing}
              nestedClasses={{ btn: classes.button }}
              color="primary"
              variant="outlined"
              text={utils.string.t('claims.actions.processing')}
            />
            <Button
              onClick={handleRegisterNewLoss}
              nestedClasses={{ btn: classes.button }}
              color="primary"
              variant="outlined"
              text={utils.string.t('claims.actions.registerNewLoss')}
            />
            <AccessControl feature="claimsFNOL.complexityRulesManagement" permissions={['read', 'create', 'update', 'delete']}>
              <Button
                onClick={handleComplexityRulesManagement}
                nestedClasses={{ btn: classes.button }}
                color="primary"
                variant="outlined"
                text={utils.string.t('claims.actions.complexityRulesManagement')}
              />
            </AccessControl>
          </div>
        </SectionHeader>
        <ClaimsList handleCreateClaim={handleCreateClaim} />
      </Layout>
    </Layout>
  );
}
